		"full_text": "마포경찰서에서 조사를 받았고, 영화제에서는 한국성폭력상담소를 소개해주었습니다. 저는 밤마다 불안발작을 하던 상황이었으므로 지푸라기 잡는 심정으로 전화를 걸었습니다. 그리고 저의 피해 상황을 전달하던 중, 상담자가 제가 전달하는 상황을 듣고 웃었고 그 일은 저에게 트라우마가 되었습니다",
